object orderExercise {
  case class a(s: Int, e: Int, sum: Int){
    def > (other: a) = (sum > other.sum || (sum == other.sum && s < other.s )
      || (sum == other.sum && s == other.s && (e-s) < (other.e - other.s)))
    def < (other: a) = (sum < other.sum || (sum == other.sum && s > other.s )
      || (sum == other.sum && s == other.s && (e-s) > (other.e - other.s)))
    def == (other: a) = false

  }
  trait aOrdering extends Ordering[a] {
    def compare(a1: a, a2: a) = {
      if (a1 > a2) 1
      else if (a1 < a2) -1
      else 0
    }
  }



  def main (args: Array[String]) {
    //def dealwithList()

    val strs: Array[String] = readLine().split(" ")
    val N: Int = strs(0).toInt
    val K: Int = strs(1).toInt
    val o: aOrdering = new aOrdering {}
    val p: mutable.PriorityQueue[a] = new mutable.PriorityQueue[a]()(o)

    val values: Array[String] = readLine.split(" ")
    val arr = new Array[Int](values.length)
    def getMax() = {}

    (0 until values.length).foreach(i => arr(i) = values(i).toInt)
    // var cur = 0
    var max = arr(0)
    var last = 0
    var isPos = arr(0) > 0
    var l: ArrayBuffer[a] = new ArrayBuffer[a]
    (1 until values.length).foreach(i => {
      if (arr(i) > 0) {
        if (isPos) max += arr(i) else { l += a(last, i - 1, max); isPos = true; last = i; max = arr(i)}
        // p += a(last, i, max)
      } else {
        if (isPos) { l += a(last, i - 1, max) ; isPos = false ; last = i; max = arr(i) } else max += arr(i)
      }
    })
    if (max > 0) l += a(last, values.length - 1, max)

    //l.foreach(println)
    val arr2 = if (l.head.sum > 0) l.toArray else l.tail.toArray
    // if arr2.last < 0
    //println("=================")
    //arr2.foreach(println)
    //println("=================")
    var i = 0
    last = arr2(0).s
    max = 0 // max always bigger than zero.
    while (i < (arr2.length - 1) ){
      val pa: a = arr2(i)
      val na: a = arr2(i+1)
      if ((pa.sum + na.sum) >= 0) { max = max + pa.sum + na.sum}
      //  else if ((pa.sum + na.sum) == 0) p += a(last, pa.e, max + pa.sum)
        else {
        // println(" last " + last + " to " + pa.e + "  sum is " + (max + pa.sum))
        p += a(last, pa.e, max + pa.sum)
        last = na.e + 1
        max = 0
      }
      i = i + 2
    }

    p += a(last, arr2(i).e, max + arr2(i).sum)

    p.toList.take(N).filter(i => i.sum > 0).map(i => i.sum).sortBy(i => -i).foreach(println)

  }
}
